import {useState,useEffect} from 'react';

function Catalog(props){
    console.log(props);
    const [data, setData] = useState({});
    let result =[];
    useEffect(()=>{
    fetch("/catalog").then(
        res=>res.json())
        .then(data=>setData(data));

    for(let i in data)
    result.push(<li>data[i].name</li>);

    },[]);
    console.log(data);
    return(
        <div>
            {result}
        </div>
    );
}
export default Catalog;
